import React from "react";
import {swapi} from "../../services/swapi/SwapiService";
import WithData from "../HOC/WithData";
import ItemList from "../ItemList";

const {
    getAllPeople,
    getAllPlanets,
    getAllStarship
} = swapi

const withChildFN = (Wrapper, FN) => {
    return (props) => {
       return <Wrapper {...props}>
            {FN}
        </Wrapper>
    }
}

const renderName = 0

const PersonList = WithData(withChildFN(ItemList, ({name})=><span>{name}</span>), getAllPeople);
const PlanetList = WithData(withChildFN(ItemList, ({name})=><span>{name}</span>), getAllPlanets);
const StarShipList = WithData(withChildFN(ItemList, ({name, model})=><span>{name} ({model})</span>), getAllStarship);

export {
    PersonList,
    PlanetList,
    StarShipList
}
